package uf

import (
	"encoding/json"
	"errors"
	"fmt"
	"math/rand"
	"testing"
	"time"
)

type E struct {
	v int
}

func (e *E) UniqueId() int {
	return e.v
}

func element(i int) IElement {
	return &E{i}
}

// initUF 用已知集合创建并查集
func initUF(u *UF, union []map[int]struct{}) error {
	for _, v := range union {
		//fmt.Println(v)
		var a = -1
		for k := range v {
			if a < 0 {
				a = k
				continue
			}
			u.UnionElements(element(a), element(k))
		}
	}
	return nil
}

// newUF 随机创建并查集
func newUF(n int, u *UF) ([]map[int]struct{}, error) {
	rand.Seed(time.Now().UnixNano())
	data := rand.Perm(n)
	var union []map[int]struct{}
	var col map[int]struct{}
	for len(data) > 0 {
		if rand.Intn(4) == 0 {
			col = make(map[int]struct{})
			union = append(union, col)
		} else {
			if len(union) == 0 {
				continue
			}
			col = union[len(union)-1]
		}
		col[data[0]] = struct{}{}
		data = data[1:]
	}
	return union, initUF(u, union)
}

// testUF 测试并查集是否正常
func testUF(n int, u *UF) error {
	// 随机并查集
	union, err := newUF(n, u)
	if err != nil {
		return err
	}
	// 验证
	var col map[int]struct{}
	for i := 0; i < n; i++ {
		for j := i + 1; j < n; j++ {
			for _, v := range union {
				if _, ok := v[i]; ok {
					col = v
					break
				}
			}
			_, ok := col[j]
			//fmt.Println(i, j, ok)
			if u.IsConnected(element(i), element(j)) != ok {
				return errors.New("IsConnected error")
			}
		}
	}
	return nil
}

func TestFindParentFuncLess(t *testing.T) {
	n := 1000
	u := TestNew(n, FindParentFuncLess)
	if err := testUF(n, u); err != nil {
		t.Error(err)
	}
}

func TestFindParentFuncMore(t *testing.T) {
	n := 1000
	u := TestNew(n, FindParentFuncMore)
	if err := testUF(n, u); err != nil {
		t.Error(err)
	}
}

